import { Component, OnInit } from '@angular/core';
import { DataServiceService } from './../services/data-service.service';
import { Router } from '@angular/router';
import {PageEvent} from '@angular/material/paginator';
@Component({
  selector: 'app-list-user',
  templateUrl: './list-user.component.html',
  styleUrls: ['./list-user.component.scss']
})
export class ListUserComponent implements OnInit {

  public datas;
  public listUser;
  public spinner: boolean = false;
  public image = [
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRblQQqYbXPjYtIpKgHfAA6y94kxNwtQtGqdr-tIoAdBCzD8uXN7Q&s',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcStaKc_Hk0IjaHdEugMCVTOtajL6UwWgsE32AIhzqctuWlRhBHP3w&s',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQUkqo0onh2lqA9k2S2GA7eFIqIO3mko6lnFc0O3uYTVpcX36YLYw&s',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR5_nggPY3mVQQnYk2bBYEn3fiYvhKnlu4a7bTiEl81Jp0omzSR&s',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
  ]

  constructor(private service: DataServiceService, private router: Router) { }

  ngOnInit() {
    const getLocal = localStorage.getItem('local');
    this.service.getPage(getLocal).subscribe(res => {
      this.datas = res['data']['list'];
      this.spinner = true;
      this.listUser = Object.keys(this.datas).map(resMap => {
        return {
          'name': this.datas[resMap].name,
          'about': this.datas[resMap].about,
          'email': this.datas[resMap].email,
          'gender': this.datas[resMap].about,
          'image': this.image[resMap],
        }
      })
    })
  }

  logout() {
    localStorage.removeItem('local');
    this.router.navigate(['/login']);
  }

}
